cy.loadIframe('iframe1')
    .loadIframe('iframe2')
    .loadIframe('iframe3')
    .loadIframe('iframe4')
    .then(() => {
    runStep([
        {
            action: 'select',
            from: {
                x: 100,
                y: 100,
            },
            to: {
                x: 300,
                y: 300,
            },
        },
        {
            action: 'rotate',
            deg: 45,
        },
    ], 'iframe1');
    runStep([
        {
            action: 'select',
            from: {
                x: 400,
                y: 100,
            },
            to: {
                x: 500,
                y: 300,
            },
        },
        {
            action: 'scale',
            units: 'px',
            width: 200,
        },
    ], 'iframe2');
    runStep([
        {
            action: 'dragAndDrop',
            from: {
                x: 400,
                y: 400,
            },
            to: {
                x: 500,
                y: 500,
            },
        },
    ], 'iframe3');
    runStep([
        {
            action: 'placeIcon',
            name: 'Eye (sagittal)',
            pos: {
                x: 500,
                y: 100,
            },
        },
    ], 'iframe4');
    // first set of screen shots
    takeFramePreviewSnapshot(undefined, 'iframe1');
    cy.get('[data-test="iframe2"]').scrollIntoView();
    takeFramePreviewSnapshot(undefined, 'iframe2');
    cy.get('[data-test="iframe3"]').scrollIntoView();
    takeFramePreviewSnapshot(undefined, 'iframe3');
    cy.get('[data-test="iframe4"]').scrollIntoView();
    takeFramePreviewSnapshot(undefined, 'iframe4');
    // leave illustration in client 1 through 3 leaving only client 4 connected
    selectorGet(Selectors.BackButton, 'iframe1').click();
    selectorGet('[data-test="gallery-content-item"]', 'iframe1').should('be.visible');
    selectorGet(Selectors.BackButton, 'iframe2').click();
    selectorGet('[data-test="gallery-content-item"]', 'iframe2').should('be.visible');
    selectorGet(Selectors.BackButton, 'iframe3').click();
    selectorGet('[data-test="gallery-content-item"]', 'iframe3').should('be.visible');
    runStep([
        {
            action: 'dragAndDrop',
            from: {
                x: 500,
                y: 100,
            },
            to: {
                x: 100,
                y: 500,
            },
        },
    ], 'iframe4');
    // come back inn frame 1
    selectorGet('[data-test="gallery-content-item"]', 'iframe1').click();
    selectorGet(Selectors.UpperCanvas, 'iframe1', { timeout: 100000 }).should('be.visible');
    runStep([
        {
            action: 'select',
            from: {
                x: 100,
                y: 100,
            },
            to: {
                x: 300,
                y: 300,
            },
        },
        {
            action: 'scale',
            units: 'px',
            width: 200,
        },
    ], 'iframe1');
    selectorGet('[data-test="gallery-content-item"]', 'iframe2').click();
    selectorGet(Selectors.UpperCanvas, 'iframe2', { timeout: 100000 }).should('be.visible');
    runStep([
        {
            action: 'select',
            from: {
                x: 400,
                y: 400,
            },
            to: {
                x: 500,
                y: 500,
            },
        },
        {
            action: 'scale',
            units: 'px',
            width: 200,
        },
    ], 'iframe4');
    runStep([
        {
            action: 'select',
            from: {
                x: 100,
                y: 400,
            },
            to: {
                x: 200,
                y: 500,
            },
        },
        {
            action: 'scale',
            units: 'px',
            width: 300,
        },
    ], 'iframe2');
    // leave 4
    selectorGet(Selectors.BackButton, 'iframe4').click();
    selectorGet('[data-test="gallery-content-item"]', 'iframe4').should('be.visible');
    // re-enter 3
    selectorGet('[data-test="gallery-content-item"]', 'iframe3').click();
    selectorGet(Selectors.UpperCanvas, 'iframe3', { timeout: 100000 }).should('be.visible');
    runStep([
        {
            action: 'dragAndDrop',
            from: {
                x: 300,
                y: 400,
            },
            to: {
                x: 50,
                y: 50,
            },
        },
    ], 'iframe3');
    // re-enter 4
    selectorGet('[data-test="gallery-content-item"]', 'iframe4').click();
    selectorGet(Selectors.UpperCanvas, 'iframe4', { timeout: 100000 }).should('be.visible');
    // second set of screen shots
    takeFramePreviewSnapshot(0.05, 'iframe1');
    cy.get('[data-test="iframe2"]').scrollIntoView();
    takeFramePreviewSnapshot(0.05, 'iframe2');
    cy.get('[data-test="iframe3"]').scrollIntoView();
    takeFramePreviewSnapshot(0.05, 'iframe3');
    cy.get('[data-test="iframe4"]').scrollIntoView();
    takeFramePreviewSnapshot(0.05, 'iframe4');
});

